pragma solidity ^0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract JNFTMarket is Ownable {
    event MarketItemCreated(
        uint256 itemId,
        uint256 tokenId,
        uint256 price,
        address nftContract,
        address seller,
        address owner
    );
    constructor(){}
    uint256 private _itemIds; // item counting
    uint256 private _itemSoldCount; //  item 
    uint256 listingPrice = 0.001 ether;

    struct MarketItem{
        uint256 itemId;         // JNFTMarket  id
        uint256 tokenId;        // NFT Contract  id
        uint256 price;          //  .
        address nftContract;    // NFT Contract address
        address seller;         //   account address
        address owner;          //   ,  NFT .
    }

    // key: itemId, value: MarketItem mapping
    mapping(uint256 => MarketItem) private idToMarketItem;

    /**
     [1.]
     setListingPrice . 
     -    , 
        listingPrice    .
     */
    function setListingPrice(uint256 _listingPrice) public onlyOwner {
        listingPrice = _listingPrice;
    }


    function withdraw(uint256 _amount) public onlyOwner {
        // address owner = owner();
        // owner.transfer(_amount);
        address payable owner = payable(owner());
        owner.transfer(_amount);
    }
    
    /**
     [2.]
     createMarketItem(address _nftContract, uint256 _tokenId, uint256 _price)
     -   .
     - ethereum listingPrice  .
     - _price 0 . ()
     - _itemIds 1  idToMarketItem id  .

     -  
     */
    function createMarketItem(address _nftContract, uint256 _tokenId, uint256 _price) public payable {
        // 1. ethereum  listingPrice 
        require(msg.value == listingPrice);
        require(_price > 0);

        //  NFT   JNFT Contract   
        // ( Tx  account  NFT token  JNFT Market  )
        // ==>     _tokenId    . 
        address nftOwner = IERC721(_nftContract).ownerOf(_tokenId); // 
        require(nftOwner == msg.sender);

        idToMarketItem[_itemIds] = MarketItem(_itemIds, _tokenId, _price, _nftContract, msg.sender, address(0));
        _itemIds++;
        //   client  marketItem Listing .
        emit MarketItemCreated(_itemIds-1, _tokenId, _price, _nftContract, msg.sender, address(0));
    }

    /**
    [3 -  contract ]
    createMarketSale(uint256 _itemId)  .: 
    -   .
    - ethereum  MarketItem price  .
    -     .

    -  JNFT contract  . (JNFT transferFrom )
    - itemsSoldCount   .
    - ethereum seller .

    -   
     */
    function createMarketSale(uint256 _itemId) public payable{
        MarketItem storage item = idToMarketItem[_itemId];
        require(msg.value == item.price); //   
        require(item.owner == address(0)); //   

        //-  JNFT contract  . (JNFT transferFrom )
        IERC721(item.nftContract).transferFrom(item.seller, msg.sender, item.tokenId);
        item.owner = msg.sender;
        _itemSoldCount++;
        // seller  
        payable(item.seller).transfer(item.price);
    }

  

     /**
     [4 -    marketItem]
     fetchUnsoldMarketItems() .
     -   .
     -       OO   .
     - return  MarketItem  .
     -    item return  .
     */
    function fetchUnsoldMarketItems() external view returns(MarketItem[] memory){
        uint256 itemCount = _itemIds; //  listing marketItemCount
        uint256 unSoldItemCount = itemCount - _itemSoldCount;

        //    marketItem return
        MarketItem[] memory unSoldMarketItems = new MarketItem[](unSoldItemCount);

        //     MarketItem  
        uint256 count = 0;
        for (uint256 i=0; i<itemCount; i++){
            if(idToMarketItem[i].owner == address(0)){
                unSoldMarketItems[count] = idToMarketItem[i];
                count++;
            }
        }
        return unSoldMarketItems;
    }


























     /**
     [5 - fetchmarketItem]
     fetchMarketItem(uint256 _itemId) .
     -   .
     -       OO   .
     - return  MarketItem .
     - _itemId  marketItem return  .
      */
}
